import React, { useEffect, useState } from "react";
import axios from "axios";
import { FaRegEdit, FaTrashAlt } from "react-icons/fa";
import { Link } from "react-router-dom";

const endpoint = "http://127.0.0.1:8000/api";

const ShowVehiculo = () => {
  const [ArrayMarcas, setArrayMarcas] = useState([]);
  const [ArrayModelos, setArrayModelos] = useState([]);
  const [vehiculos, setVehiculos] = useState([]);
  useEffect(() => {
    getAllVehiculo();
    getMarcasAll();
    getModelosAll();
  }, []);

  const getAllVehiculo = async () => {
    const response = await axios.get(`${endpoint}/vehiculo`, {
      /*params: {
        id_tipo_vehiculo: 1,
      },*/
    });
    setVehiculos(response.data);
  };

  const deleteVehiculo = async (id) => {
    await axios.delete(`${endpoint}/vehiculo/${id}`);
    getAllVehiculo();
  };
  const getMarcasAll = async () => {
    const response = await axios.get(`${endpointMarca}`);
    setArrayMarcas(response.data);
  };

  const getModelosAll = async () => {
    const response = await axios.get(`${endpointModelo}`);
    setArrayModelos(response.data);
  };

  return (
    <div>
      <div class="crud shadow-lg p-0 mb-2 mt-2 bg-body rounded">
        <div class="row ">
          <div class="col-xs-12 mt-1 mb-1 text-gred" style={{ color: "green" }}>
            <h2>Listado</h2>
          </div>
          <div class="col-sm-4 mb-2 text-gred">
            <label>
              Marcas
              <select
                value={id_marca}
                onChange={(e) => setIdMarca(e.target.value)}
                class="form-select mb-3"
              >
                {ArrayMarcas.map((data) => (
                  <option key={data.id} value={data.id}>
                    {data.descripcion}
                  </option>
                ))}
              </select>
            </label>
          </div>
          <div class="col-sm-4 text-gred">
            <label>
              Modelos
              <select
                value={id_modelo}
                onChange={(e) => setIdModelo(e.target.value)}
                class="form-select mb-3"
              >
                {ArrayModelos.map((data) => (
                  <option key={data.id} value={data.id}>
                    {data.descripcion}
                  </option>
                ))}
              </select>
            </label>
          </div>
          <div class="col-sm-4 text-gred">
            <Link to="/add" class="btn btn-success btn-lg mt-2 mb-2 text-white">
              Agregar
            </Link>
          </div>
        </div>
      </div>
      <table class="table table-striped">
        <thead class="bg-primary text-white">
          <tr>
            <th>Patente</th>
            <th>Numero Chasis</th>
            <th>Tipo de Vehiculo</th>
            <th>Cantidad de Ruedas</th>
            <th>Marca</th>
            <th>Modelo</th>
            <th>Kilometraje</th>
            <th>Acciones</th>
          </tr>
        </thead>
        <tbody>
          {vehiculos.map((vehiculo) => (
            <tr key={vehiculo.id}>
              <td>{vehiculo.patente}</td>
              <td>{vehiculo.numero_chasis}</td>
              <td>{vehiculo.tipo_vehiculo.descripcion}</td>
              <td>{vehiculo.cantidad_ruedas}</td>
              <td>{vehiculo.marca.descripcion}</td>
              <td>{vehiculo.modelo.descripcion}</td>
              <td>{vehiculo.kilometraje}</td>
              <td>
                <Link to={`/mod/${vehiculo.id}`} class="btn btn-warning">
                  <FaRegEdit />
                </Link>
                <button
                  onClick={() => deleteVehiculo(vehiculo.id)}
                  class="btn btn-danger"
                >
                  <FaTrashAlt />
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ShowVehiculo;
